\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen a problem is disturbing you, don’t ask, “What should I do about it?” Ask, “What part of me is being disturbed by this?”\n\nNovember 28, 2014\n\u001c20\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis is the essential difference between a spiritually minded person and a worldly person. Worldly doesn’t mean that you have money or stature. Worldly means that you think the solution to your inner problems is in the world outside. You think that if you change things outside, you’ll be okay. But nobody has ever truly become okay by changing things outside. There’s always the next problem. The only real solution is to take the seat of witness consciousness and completely change your frame of reference.\n\nNovember 28, 2014\n\u001c20\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou will not be able to solve anything outside until you own how the situation affects you inside. Problems are generally not what they appear to be. When you get clear enough, you will realize that the real problem is that there is something inside of you that can have a problem with almost anything. The first step is to deal with that part of you. This involves a change from “outer solution consciousness” to “inner solution consciousness.” You have to break the habit of thinking that the solution to your problems is to rearrange things outside. The only permanent solution to your problems is to go inside and let go of the part of you that seems to have so many problems with reality\n\nNovember 28, 2014\n\u001c21\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbeautiful. But every time you drive it, your inner roommate finds something wrong with it. The mental voice keeps pointing out every little squeak, every little vibration, until eventually you don’t even like the car anymore. Once you see what this can do to your life, you are ready for spiritual growth. You’re ready for real transformation\n\nNovember 28, 2014\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne day it likes someone, and the next day it decides to pick on everything they do. My life is a mess just because this thing that lives in here with me has to make a melodrama out of everything.” Once you’ve seen this, and learn to no longer identify with your roommate, you’re ready to free yourself.\n\nNovember 28, 2014\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbursts of conflicting dialogue just keep going on and on. And as if that’s not enough, instead of simply watching TV, this person starts verbally reacting to whatever comes on the screen. At one point, after a redhead appears on the show, your couch-mate starts mumbling about an ex-spouse and a painful divorce. Then the yelling starts—just as though the ex-spouse were in the room with you! Then it stops, just as suddenly as it started. At this point, you find yourself hugging the far corner of the couch in a desperate attempt to get as far away from this disturbed person as you possibly can.\n\nNovember 28, 2014\n\u001c24\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDon’t try to make the person stop talking. Just try to get to know what you live with inside by externalizing the voice. Give it a body and put it out there in the world just like everybody else. Let it be a person who says on the outside exactly what the voice of your mind says inside. Now make that person your best friend. After all, how many friends do you spend all of your time with and pay absolute attention to every word they say?\n\nNovember 28, 2014\n\u001c25\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat being the case, once you’ve spent a day with your friend, what is the probability you’d go to them for advice? After seeing how often this person changed their mind, how conflicted they were on so many subjects, and how emotionally overreactive they tended to be, would you ever ask them for relationship or financial advice?\n\nNovember 28, 2014\n\u001c26\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cally wrong? “She doesn’t care for you anymore. That’s why she hasn’t called. She’s going to break up with you tonight. I can feel it coming; I just know it. You shouldn’t even answer the phone if she calls.” After thirty minutes of this, the phone rings and it’s your girlfriend. She’s late because it’s your one-year anniversary and she was preparing for a surprise dinner. It was definitely a surprise to you, since you completely forgot the anniversary. She says she’s on her way over to pick you up\n\nNovember 28, 2014\n\u001c26\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1J2d6B0sLBGFJXcYLPLYE-alFgjHJAesgMwmi81o","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1NWO45L5nbEBB2O2RUjGfdznGAt7Fy8syVlxHhKQ","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"l