e,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4486,"ei":4504,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4505,"ei":4510,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunk = [{"ty":"is","ibi":4511,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you’ve sincerely tried these practices of self-observation and awareness, you’ll see that you’re in trouble. You’ll realize that you’ve only had one problem your entire life, and you’re looking at it. It’s pretty much the cause of every problem you’ve ever had. Now the question becomes, how do you get rid of this inner troublemaker? The first thing you’ll realize is that there’s no hope of getting rid of it until you really want to. Until you’ve watched your roommate long enough to truly understand the predicament you’re in, you really have no basis for practices that help you deal with the mind. Once you’ve made the decision to free yourself from the mental melodrama, you are ready for teachings and techniques. You will now have a real use for them.\n\nNovember 28, 2014\n\u001c27\n\u0011\n\u0011\n\n\n4. the lucid self\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou know that if certain things happen, one or more of these emotions will flare up and dominate your awareness. Then, eventually, they will settle back down to the norm. You know this so well that you are very busy inside making sure nothing happens to create these disturbances. In fact, you are so preoccupied with controlling your world of thoughts, emotions, and physical\n\nNovember 28, 2014\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csensations that you don’t even know you’re in there. That is the normal state for most people.\n\nNovember 28, 2014\n\u001c39\n\u0011\n\u0011\n\n\n5. infinite energy\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe only reason you don’t feel this energy all the time is because you block it. You block it by closing your heart, by closing your mind, and by pulling yourself into a restrictive space inside. This closes you off from all the energy. When you close your heart or close your mind, you hide in the darkness within you. There is no light. There is no energy. There is nothing flowing. The energy is still there but it can’t get in.\n\nNovember 28, 2014\n\u001c49\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat spiritual energy is what you’re experiencing when love rushes up into your heart. That is what you’re experiencing when you’re enthused by something and all this high energy comes up inside of you.\n\nNovember 28, 2014\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cit’s yours. It’s your birthright, and it’s unlimited. You can call upon it any time you want. It has nothing to do with age. Some eighty-year-old people have the energy and enthusiasm of a child. They can work long hours for seven days a week. It’s just energy. Energy doesn’t get old, it doesn’t get tired, and it doesn’t need food. What it needs is openness and receptivity. This energy is equally available to everybody. The sun does not shine differently on different people. If you’re good, it shines on you. If you did something bad, it shines on you. It’s the same with the inner energy. The only difference is that with the inner energy, you have the ability to close up inside and block it. When you close, the energy stops flowing. When you open, all the energy rushes up inside of you. True spiritual teachings are about this energy and how to open to it.\n\nNovember 28, 2014\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere is a very simple method for staying open. You stay open by never closing. It’s really that simple. All you have to do is decide whether you are willing to stay open, or whether you think it’s worth closing. You can actually train yourself to forget how to close. Closing is a habit, and just like any other habit, it can be broken\n\nNovember 28, 2014\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou can train yourself to open every time you see a person.\n\nNovember 28, 2014\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s just a question of whether you want to close or whether you want to open. It’s ultimately under your control. The problem is, we don’t exercise that control. Under normal circumstances, our state of openness is left to psychological factors. Basically, we are programmed to open or close based upon our past experiences. Impressions from the past are still inside of us, and they get stimulated by different events. If they were negative impressions, we tend to close. If they were positive impressions, we tend to open.\n\nNovember 28, 2014\n\u001c51\n\u0011\n\u0011"},{"ty":"te","id":"i.10","spi":4520},{"ty":"te","id":"i.11","spi":5344},{"ty":"te","id":"i.12","spi":5759},{"ty":"te","id":"i.13","spi":5913},{"ty":"te","id":"i.14","spi":6383},{"ty":"te","id":"i.15","spi":6624},{"ty":"te","id":"i.16","spi":7529},{"ty":"te","id":"i.17","spi":7904},{"ty":"te","id":"i.18","spi":8002},{"ty":"as","st":"paragraph","si":4511,"ei":4511,"sm":{"ps_klt_i":true,"ps_sb_i":tru