:{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":7870,"ei":7888,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7907,"ei":7967,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":7968,"ei":7986,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":8005,"ei":8531,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8532,"ei":8550,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunk = [{"ty":"is","ibi":8557,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe are programmed based upon our past impressions such that all kinds of things can cause us to open and close. If you pay attention, you will see it happen regularly throughout each day.\n\nNovember 28, 2014\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut you should never leave something as important as your energy flow to chance. If you like energy, and you do, then don’t ever close. The more you learn to stay open, the more the energy can flow into you. You practice opening by not closing. Any time you start to close, ask yourself whether you really want to cut off the energy flow.\n\nNovember 28, 2014\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou just make a commitment to explore your capacity for receiving unlimited energy. You simply decide not to close. At first it feels unnatural since your innate tendency is to close as a means of protection. But closing your heart does not really protect you from anything; it just cuts you off from your source of energy. In the end, it only serves to lock you inside.\n\nNovember 28, 2014\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat you’ll find is that the only thing you really want from life is to feel enthusiasm, joy, and love. If you can feel that all the time, then who cares what happens outside? If you can always feel up, if you can always feel excited about the experience of the moment, then it doesn’t make any difference what the experience is. No matter what it is, it’s beautiful when you feel that way inside. So you learn to stay open no matter what happens.\n\nNovember 28, 2014\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 28, 2014\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDo not let anything that happens in life be important enough that you’re willing to close your heart over it. When your heart starts to close, just say, “No. I’m not going to close. I’m going to relax. I’m going to let this situation take place and be there with it.” Honor and respect the situation, and deal with it. By all means deal with it. Do the best you can. But deal with it with openness. Deal with it with excitement and enthusiasm. No matter what it is, just let it be the sport of the day.\n\nNovember 28, 2014\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you really want to stay open, pay attention when you feel love and enthusiasm. Then ask yourself why you can’t feel this all the time. Why does it have to go away? The answer is obvious: it only goes away if you choose to close. By closing, you are actually making the choice not to feel openness and love. You throw love away all the time. You feel love until somebody says something you don’t like, and then you give up the love. You feel enthused about your job until\n\nNovember 28, 2014\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csomeone criticizes something, and then you want to quit. It’s your choice. You can either close because you don’t like what happened, or you can keep feeling love and enthusiasm by not closing. As long as you are defining what you like and what you don’t like, you will open and close. You are actually defining your limits. You are allowing your mind to create triggers that open and close you. Let go of that. Dare to be different. Enjoy all of life\n\nNovember 28, 2014\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat is more, the energy affects other people. People can pick up on your energy,\n\nNovember 28, 2014\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you are willing to open even more, it never stops. You become a source of light for all those around you.\n\nNovember 28, 2014\n\u001c54\n\u0011\n\u0011\n\n\n6. the secrets of the spiritual heart\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 28, 2014\n\u001c59\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 28, 2014\n\u001c61\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe highest state you have ever experienced is simply the result of how open you were. If you don’t close, it can be like that all the time. Don’t sell yourself short. This can go on all the time—unending inspiration, unending love, and unending openness. That is the natural state of a healthy heart. To achieve this state, simply allow the experiences of life to come in and pass through your being. If old energies come back up because you were unable to process them before, let go of them now. It’s that easy. When that light blue Mustang drives by and you feel fear or jealousy, just smile. Be happy that this Samskara, which has been stored down there for all this time, has the opportunity to make it through you. Just open, relax your heart, forgive, laugh, or do anything you want.\n\nNovember 28, 2014\n\u001c64\n\u0011\n\u0011"},{"ty":"te","id":"i.19","spi":8566},{"ty":"te","id":"i.20","spi":8792},{"ty":"te","id":"i.21","spi":9169},{"ty":"te","id":"i.22","spi":9578},{"ty":"te","id":"i.23","spi":10064},{"ty":"te","id":"i.24","spi":10101},{"ty":"te","id":"i.25","spi":10642},{"ty":"te","id":"i.26","spi":11154},{"ty":"te","id":"i.27","spi":11644},{"ty":"te","id":"i.28","spi":11764},{"ty":"te","id":"i.29","spi":11951},{"ty":"te","id":"i.30","spi":11988},{"ty":"te","id":"i.31","spi":12025},{"ty":"as","st":"paragraph","si":8557,"ei":8557,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8558,"ei":8558,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8559,"ei":8559,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8561,"ei":8561,"sm":{"cell_pb_i":fals