 minute and then it’s over.\n\nNovember 28, 2014\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo, you have a choice: Do you want to try to change the world so it doesn’t disturb your Samskaras, or are you willing to go through this process of purification?\n\nNovember 28, 2014\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAllow yourself to experience every note the heart can play. If you relax and release, this purification of your heart is a wonderful thing. Set your eyes on the highest state you can imagine and don’t take them off. If you slip, just get back up. It doesn’t matter. The very fact that you even want to go through this process of freeing the energy flow means you are great. You will get there. Just keep letting go.\n\nNovember 28, 2014\n\u001c65\n\u0011\n\u0011\n\n\n7. transcending the tendency to close\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cprotective energies have adapted toward defending the individual psychologically, rather than physiologically. We now experience the daily need to defend our self-­concepts rather than our bodies. Our major struggles end up being with our own inner fears, insecurities, and destructive\n\nNovember 28, 2014\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSince it’s not socially acceptable to run into the woods and hide like a deer, you hide inside. You withdraw, close down, and pull back behind your protective shield. What you are actually doing is closing down your energy centers\n\nNovember 28, 2014\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBecause most of us don’t have to worry about food, clothing, or shelter, we have the luxury of worrying about a spot on our pants, or laughing too loud, or saying something wrong. Because we’ve developed this hypersensitive psyche, we constantly use our energies to close around it and protect ourselves. But this process only hides the problems; it doesn’t fix them. You’re locking your illness inside yourself, and it will only get worse.\n\nNovember 28, 2014\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou will get to a point in your growth where you understand that if you protect yourself, you will never be free.\n\nNovember 28, 2014\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cUltimately, if you protect yourself perfectly, you will never grow. All your habits and idiosyncrasies will stay the same. Life becomes stagnant when people protect their stored issues. People say things like, “You know we don’t talk about that subject around your father.” There are all these rules about things that are not supposed to happen outside because they could cause disturbance inside. Living like this allows for very little spontaneous joy, enthusiasm, and excitement for life. Most people just go from day to day protecting themselves and making sure nothing goes too wrong.\n\nNovember 28, 2014\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNot too bad,” or “I’ll survive.” What is that telling you about their view of life? They see life as a threat. A good day means you made it through without getting hurt. The longer you live like this, the more closed you become.\n\nNovember 28, 2014\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you close, you have to make sure that what you protected doesn’t get disturbed. You then carry this task for the rest of your life. The alternative is to become conscious enough to simply watch the part of your being that is constantly trying to protect itself. You can then give yourself the ultimate gift by deciding not to do that anymore. You decide, instead, to get rid of that part.\n\nNovember 28, 2014\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHow often do you find yourself trying to protect and defend that weak part of you? You feel like the world wants to get right at it. Every place you go there’s someone or something trying to disturb you, trying to get your goat. Why not let them have it? If you don’t really want it, then don’t protect it.\n\nNovember 28, 2014\n\u001c69\n\u0011\n\u0011"},{"ty":"te","id":"i.32","spi":12855},{"ty":"te","id":"i.33","spi":12912},{"ty":"te","id":"i.34","spi":13293},{"ty":"te","id":"i.35","spi":13494},{"ty":"te","id":"i.36","spi":13988},{"ty":"te","id":"i.37","spi":14312},{"ty":"te","id":"i.38","spi":14581},{"ty":"te","id":"i.39","spi":15060},{"ty":"te","id":"i.40","spi":15212},{"ty":"te","id":"i.41","spi":15840},{"ty":"te","id":"i.42","spi":16107},{"ty":"te","id":"i.43","spi":16539},{"ty":"as","st":"paragraph","si":12846,"ei":12846,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":12847,"ei":12847,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":12848,"ei":12848,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":12850,"ei":12850,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":12852,"ei":12852,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":12854,"ei":12854,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_