m":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16505,"ei":16523,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":16542,"ei":16849,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16850,"ei":16868,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunk = [{"ty":"is","ibi":16875,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou no longer have to listen to “What will they think of me?” or, “Oh God, I wish I hadn’t said that. It sounded so stupid.” You just go about your business and put your whole being into whatever’s happening, instead of putting your whole being into your personal sensitivity\n\nNovember 29, 2014\n\u001c70\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou will eventually get conscious enough so that the minute you see the energy start getting strange, you stop. You stop getting involved in the energy. If it normally causes you to start talking, you stop talking. You just stop, mid-sentence, because you know where it will go if you continue. The moment you see the energy getting imbalanced inside, the moment you see the heart starting to tense and get defensive, you just stop. What exactly does it mean “to stop”? It’s something you do inside. It’s called letting go. When you let go, you are falling behind the energy that is trying to pull you into it. Your energies inside have power. They are very strong, and they draw your awareness into them.\n\nNovember 29, 2014\n\u001c70\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 30, 2014\n\u001c71\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThey’re both gone together because you didn’t go with them. That is what’s called being centered. If you aren’t centered, your consciousness is just following whatever catches its attention. You see the car drive by and you’re off doing something about it. Another day you see a boat, and then it is all about the boat, and you forget about the car. There are people like that. They don’t hold jobs very well and relationships don’t tend to work out for them. They’re just all over the place; their energy is very scattered\n\nNovember 30, 2014\n\u001c71\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you want to be free, then every time you feel any change in the energy flow, relax behind it. Don’t fight with it, don’t try to change it, and don’t judge it. Don’t say, “Oh, I can’t believe I’m still feeling this. I promised myself I wouldn’t think about that car anymore.” Don’t do that; you’ll just end up going with the guilt thoughts instead of the car thoughts. You have to let them all go\n\nNovember 30, 2014\n\u001c72\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c. We tend to let ourselves get bothered by the little, meaningless things that happen every day. For example, somebody beeps at you at the stoplight. As these little things happen, you will feel your energy change. The moment you feel a change, relax your shoulders and relax the area around your heart. The moment the energy moves, you simply relax and release. Play with letting go and falling behind this sense of being bothered. Let’s say someone at work took your pencil, and you notice that every time you go to use another one, your inner energy shifts—even the slightest amount. Are you willing to release the old pencil in order to liberate yourself? This is how you make freedom a game. Instead of getting into being bothered, you get into being free\n\nNovember 30, 2014\n\u001c73\n\u0011\n\u0011\n\n\n8. let go now or fall\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe stuff that holds you down periodically rears its head. When it does, let it go. You simply permit the pain to come up into your heart and pass through. If you do that, it will pass. If you are sincerely seeking truth, you’ll let go every time. T\n\nNovember 30, 2014\n\u001c81\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s one thing if the disturbance is going on inside of you. But the moment you allow it to express itself, the moment you let that energy move your body, you have descended to another level. Now it’s almost impossible to let go. If you start yelling at somebody, if you actually tell someone how you feel about them from this state of nonclarity, you have involved that person’s heart and mind in your stuff. Now both of your egos are involved. Once you externalize these energies, you will want to defend your actions and make them look appropriate. But the other person will never think they were appropriate.\n\nNovember 30, 2014\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat is how negative cycles happen. You actually take a piece of your stuff, which is nothing but deeply seated disturbance from your past, and you implant it in the hearts of those around you. At some point it will come back to you. Anything you put out comes back. Imagine if you got upset and fully released your disturbed energies onto another person. This is how people ruin relationships and destroy their lives.\n\nNovember 30, 2014\n\u001c85\n\u0011\n\u0011"},{"ty":"te","id":"i.44","spi":16884},{"ty":"te","id":"i.45","spi":17198},{"ty":"te","id":"i.46","spi":17942},{"ty":"te","id":"i.47","spi":17979},{"ty":"te","id":"i.48","spi":18541},{"ty":"te","id":"i.49","spi":18978},{"ty":"te","id":"i.50","spi":19801},{"ty":"te","id":"i.51","spi":20089},{"ty":"te","id":"i.52","spi":20740},{"ty":"as","st":"paragraph","si":16875,"ei":16875,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":16876,"ei":16876,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":16877,"ei":16877,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":16879,"ei":16879,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":16881,"ei":16881,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":16883,"ei":16883,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":16885,"ei":16885,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_il_i":true