ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21163,"ei":21181,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunk = [{"ty":"is","ibi":21188,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNo matter what happens below you, just turn your eyes upward and relax your heart. You do not have to leave the seat of Self in order to deal with the darkness. It will purify itself if you let it. Getting involved in the darkness does not dispel darkness; it feeds it. Don’t even turn toward it. If you see disturbed energies within you, it’s okay. Don’t think that you don’t have blockages left to release. Just sit in the seat of awareness and never leave. No matter what goes on below you, open your heart and let it go. Your heart will become purified, and you will never know another fall.\n\nNovember 30, 2014\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAlways let go as soon as you’re aware that you didn’t. Don’t waste your time; use the energy to go up. You are a great being who has been given a tremendous opportunity to explore beyond yourself. The whole process is very exciting, and you will have good times and bad times. All sorts of things will happen. That’s the fun of the journey. So don’t fall. Let go. No matter what it is, let it go. The bigger it is, the higher the reward of letting go and the worse the fall if you don’t. It’s pretty black-and-white. You either let go or you don’t.\n\nNovember 30, 2014\n\u001c86\n\u0011\n\u0011\n\n\n9. removing your inner thorn\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou want to be free of this. You want to talk to people because you find them interesting, not because you’re lonely. You want to have relationships with people because you genuinely like them, not because you need for them to like you. You want to love because you truly love, not because you need to avoid your inner problems. How do you free yourself? In the deepest sense, you free yourself by finding yourself. You are not the pain you feel, nor are you the part that periodically stresses out. None of these disturbances have anything to do with you. You are the one who notices these things. Because your consciousness is separate and aware of these things, you can free yourself. To free yourself of your inner thorns, you simply stop playing with them. The more you touch them, the more you irritate them.\n\nNovember 30, 2014\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat can you do to solve this besides eating something, calling somebody, or doing something else that might quiet it down? What you can do is notice that you noticed. You can notice that your consciousness was watching TV, and now it is watching your inner melodrama. The one who sees this is you, the subject. What you are looking at is an object. A feeling of emptiness is an object; it is something you feel. But who feels it? Your way out is to just notice who’s noticing. It’s really that simple\n\nNovember 30, 2014\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you pay attention, you will see that they are not you; they are just something you’re feeling and experiencing. You are the indwelling being that is aware of all of this. If you maintain your center, you can learn to appreciate and respect even the difficult experiences.\n\nNovember 30, 2014\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you learn that it’s okay to feel inner disturbances, and that they can no longer disturb your seat of consciousness, you will be free.\n\nNovember 30, 2014\n\u001c95\n\u0011\n\u0011\n\n\n10. stealing freedom for your soul\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 30, 2014\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou could enjoy things, and you could actually get to know people instead of needing them. You could just live and experience your life, instead of trying to use life to fix what’s wrong inside of you. You are capable of achieving that state.\n\nNovember 30, 2014\n\u001c101\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 30, 2014\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhen your mind starts telling you what you have to do to make everything inside okay, don’t buy into what it’s telling you. The truth is, everything will be okay as soon as you are okay with everything. And that’s the only time everything will be okay.\n\nNovember 30, 2014\n\u001c103\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe mind is simply a computer, a tool. It can be used to ponder great thoughts, solve scientific problems, and serve humanity. But you, in your lost state, told it to spend its time conjuring up outer solutions for your very personal inner problems. You are the one who is trying to use the analytical mind to protect yourself from the natural unfolding of life.\n\nNovember 30, 2014\n\u001c103\n\u0011\n\u0011"},{"ty":"te","id":"i.53","spi":21197},{"ty":"te","id":"i.54","spi":21831},{"ty":"te","id":"i.55","spi":22449},{"ty":"te","id":"i.56","spi":23302},{"ty":"te","id":"i.57","spi":23842},{"ty":"te