s_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunk = [{"ty":"is","ibi":25413,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 30, 2014\n\u001c103\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cUse these little things that happen in daily life to free yourself. In the above example, you simply choose not to get involved in the psyche. Does that mean that you stop your mind from going around in circles trying to figure out what’s going on? No. It simply means that you are ready, willing, and able to watch your mind create its little melodrama. Watch all of its noise about how hurt you are, and how could anybody do that. Watch the mind try to figure out what to do about it. Just marvel at the fact that all of this is going on inside simply because someone didn’t say hello to you. It’s truly unbelievable. Just watch the mind talk, and keep relaxing and releasing. Fall behind the nois\n\nNovember 30, 2014\n\u001c104\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou will soon see that your mind is constantly driving you crazy over nothing. If you don’t want to be like that, then stop putting energy into your psyche. That is all there is to it. If you follow this path, the only action you ever take is to relax and release. When you start to see this stuff going on inside, you just relax your shoulders, relax your heart, and fall back behind it. Do not touch it. Do not get involved in it. And do not try to stop it. Simply be aware that you are seeing it. That’s how you get out. You just let it go\n\nNovember 30, 2014\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cjust stop. Take a moment to remember that you’re spinning on a planet in the middle of empty space. Then remind yourself that you’re not going to get involved in your own melodrama. In other words, let go of what is going on right then, and remind yourself that you don’t want to play the mind game. Then, before you get out of your car, do the same thing. And if you really want to stay centered, you can also do this before you pick up the phone or open a door. You don’t have to change anything. Just be there, noticing that you notice. It’s like taking inventory. Just check out what’s going on—heart, mind, shoulders, etc. Set up trigger points in everyday life that help you remember who you are and what’s going on in\n\nNovember 30, 2014\n\u001c105\n\u0011\n\u0011\n\n\n11. pain, the price of freedom\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 30, 2014\n\u001c107\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you are doing something to avoid pain, then pain is running your life. All of your thoughts and feelings will be affected by your fears\n\nDecember 3, 2014\n\u001c108\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you do not want to deal with the pain at its core, then what you do to avoid it had better work. If you are hiding yourself in a busy social life, then anything anyone does that challenges your self-esteem, such as not inviting you to an event, will cause you to feel the pain. Let’s say you call a friend to go see a movie, and they say they’re busy. Some people feel hurt by that. You will feel pain if the reason you called them was the avoidance of pain. Let’s say you go outside and you call your dog, “Hey, Spot, come here!” and he doesn’t come. If the reason you called Spot was to feed him, you’d just put the bowl down and let him eat when he wants\n\nDecember 3, 2014\n\u001c108\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt the core there is the pain. Then, in order to avoid the pain, you try to stay busy with friends and hide in their acceptance. That is the first layer out. Then, in order to assure your acceptance, you try to present yourself a certain way so that you can win friends and influence people.\n\nDecember 3, 2014\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou end up so sensitive that you are unable to live in this world without getting hurt. You cannot even interact with people or do other normal daily activities without events affecting your heart. If you watch carefully, you will see that even simple interactions often cause some degree of pain, insecurity, or general disturbance.\n\nDecember 3, 2014\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo get some distance from this, you first need to get some perspective. Walk outside on a clear night and just look up into the sky. You are sitting on a planet spinning around in the middle of absolutely nowhere.\n\nDecember 3, 2014\n\u001c110\n\u0011\n\u0011"},{"ty":"te","id":"i.64","spi":25422},{"ty":"te","id":"i.65","spi":25460},{"ty":"te","id":"i.66","spi":26199},{"ty":"te","id":"i.67","spi":26781},{"ty":"te","id":"i.68","spi":27578},{"ty":"te","id":"i.69","spi":27616},{"ty":"te","id":"i.70","spi":27793},{"ty":"te","id":"i.71","spi":28492},{"ty":"te","id":"i.72","spi":28822},{"ty":"te","id":"i.73","spi":29194},{"ty":"as","st":"paragraph","si":25413,"ei":25413,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":25414,"ei":25414,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_