"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":29197,"ei":29411,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":29412,"ei":29429,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunk = [{"ty":"is","ibi":29437,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou’re just standing on one little ball of dirt and spinning around one of the stars. From that perspective, do you really care what people think about your clothes or your car?\n\nDecember 3, 2014\n\u001c110\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 3, 2014\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you want to be free, simply view inner pain as a temporary shift in your energy flow. There is no reason to fear this experience. You must not be afraid of rejection, or of how you would feel if you got sick, or if someone died, or if something else went wrong. You cannot spend your life avoiding things that are not actually happening, or everything will become negative. All you will end up seeing is how much can potentially go wrong.\n\nDecember 3, 2014\n\u001c111\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou must look inside yourself and determine that from now on pain is not a problem. It is just a thing in the universe. Somebody can say something to you that can cause your heart to react and catch fire, but then it passes. It’s a temporary experience. Most people can hardly imagine what it would be like to be at peace with inner disturbance. But if you do not learn to be comfortable with it, you will devote your life to avoiding it. If you feel insecurity, it’s just a feeling. You can handle a feeling. If you feel embarrassed, it’s just a feeling. It’s just a part of creation. If you feel jealousy and your heart burns, just look at it objectively, like you would a mild bruise\n\nDecember 3, 2014\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s a thing in the universe that is passing through your system. Laugh at it, have fun with it, but don’t be afraid of it. It cannot touch you unless you touch it.\n\nDecember 3, 2014\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLet’s explore this by first looking at a basic human tendency. When something painful touches your body, you tend to pull away instinctively. You even do this with unpleasant smells and tastes. The fact is, your psyche does the same thing. If something disturbing touches it, its ­tendency is to withdraw, to pull back, and to protect itself. It does this with insecurity, jealousy, and any of the other vibrations we’ve been discussing. In essence, you “close,” which is simply an attempt to put a shield around your inner energy. You can feel the effects of this as the sensation of contracting within your heart. Somebody says something displeasing, and you feel some disturbance in your heart. Then your mind starts talking: “I don’t have to put up with this. I’ll just walk away\n\nWe say D-Rose shouldn\u0027t worry about reaggravating his ACL. That he should play without fear and recognize that acls are a fear accident. It\u0027s all in the mind. Same thing with me. I avoid her because I don\u0027t want to think of the pain. But that\u0027s just a thought. Fleeting. Its nothing I need to fear anymore. Its imaginary. React with love or fear. Open or close.\n\nDecember 3, 2014\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou will never be free, however, until you get to the point where you are willing to release the initial pain instead of avoiding it. You must learn to transcend the tendency to avoid the pain. Wise beings do not want to remain a slave to the fear of pain. They permit the world to be what it is instead of being afraid of it. They wholeheartedly participate in life, but not for the purpose of using life to avoid themselves. If life does something that causes a disturbance inside of you, instead of pulling away, let it pass through you like the wind. After all, things happen every day that cause inner disturbance\n\nDecember 3, 2014\n\u001c113\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 3, 2014\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you feel pain, simply view it as energy. Just start seeing these inner experiences as energy passing through your heart and before the eye of your consciousness. Then relax. Do the opposite of contracting and closing. Relax and release. Relax your heart until you are actually face-to-face with the exact place where it hurts. Stay open and receptive so you can be present right where the tension is. You must be willing to be present right at the place of the tightness and pain, and then relax and go even deeper. This is very deep growth and transformation. But you will not want to do this. You will feel tremendous resistance to doing this, and that’s what makes it so powerful.\n\nDecember 3, 2014\n\u001c114\n\u0011\n\u0011"},{"ty":"te","id":"i.74","spi":29446},{"ty":"te","id":"i.75","sp