s","st":"text","si":32295,"ei":32914,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":32915,"ei":32932,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":32952,"ei":32969,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":32989,"ei":33678,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":33679,"ei":33696,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8"  nonce="lQCDYsM7b26+/Gp7I9Fuyheqys8">DOCS_modelChunk = [{"ty":"is","ibi":33704,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe heart will want to pull away, to close, to protect, and to defend itself. Keep relaxing. Relax your shoulders and relax your heart. Let go and give room for the pain to pass through you. It’s just energy. Just see it as energy and let it go.\n\nDecember 3, 2014\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you relax when the pain comes up inside your heart, and actually dare to face it, it will pass. Every single time you relax and release, a piece of the pain leaves forever.\n\nDecember 3, 2014\n\u001c114\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere is also tremendous joy, beauty, love, and peace within you. But they are on the other side of the pain. On the other side of the pain is ecstasy. On the other side is freedom. Your true greatness hides on the other side of that layer of pain. You must be willing to accept pain in order to pass through to the other side. Just accept that it is in there and that you are going to feel it. Accept that if you relax, it will have its moment before your awareness, and then it will pass. It always does.\n\nDecember 3, 2014\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn fact, as you relax into the energy of the pain, you may feel tremendous heat in your heart. That is the pain being purified from your heart. Learn to enjoy that burning. It is called the fire of yoga. It does not seem enjoyable, but you will learn to enjoy it because it is freeing you. In truth, pain is the price of freedom. And the moment you are willing to pay that price, you will no longer be afraid. The moment you are not afraid of the pain, you’ll be able to face all of life’s situations without fear\n\nDecember 3, 2014\n\u001c115\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRemember, if you close around something, you will be psychologically sensitive about that subject for the rest of your life\n\nI don\u0027t wanna be psychologically trapped by my jasc 65 Yasuko experience. Or by my betrayal of dear Luke. Or by my struggles with porn and self confidence. Or by my dishonesty in that western in my thesis. Hey kenshin used to be the battosai. Face the pain. Release it. And then make amends in the most honest, pure, way possible, learning from what u did.\n\nDecember 3, 2014\n\u001c116\n\u0011\n\u0011\n\n\n12. taking down the walls\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 3, 2014\n\u001c123\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat which you collected from your past forms a boundary that you intuitively want to avoid\n\nWe form our own invisible walls. Inside us\n\nDecember 3, 2014\n\u001c123\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you see a wall and it is protecting you from unending darkness, you will not want to go there. But if you see a wall that is blocking the light, you will want to go there in order to remove the wall. It is often said that you must go through the darkest night in order to get to the infinite light. This is because what we call darkness is really the blockage of light. You must go past these walls. It’s not really difficult to get past the walls. Time and again, every day, the natural flow of life collides with our walls and tries to tear them down. But time and again, we defend them. You must realize that when you defend yourself, you are really defending your walls. There is nothing else to defend in there. There is just your awareness of being and the limited house you built to live in. What you are defending is the house you built to protect yourself.\n\nDecember 3, 2014\n\u001c124\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you say, “I’m a woman and I’m forty-five years old. I’m married to Joe and I graduated from this school…” those are thoughts. The actual situations don’t exist in there with you except in the form of thoughts that you cling to: “But I was a cheerleader, and I was president of my senior class.” That was thirty years ago. Those situations don’t exist anymore. But they exist inside of you, and they form the walls in which you live. What if somebody challenges your self-concept and breaks a little hole in it? What if somebody manages to shake one of those foundational thoughts that the house of your psyche is built upon?\n\nDecember 3, 2014\n\u001c124\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyou can step outside your house of thoughts into the unlimited. Your awareness can expand to encompass vast space instead of the limited space in which you dwell\n\nDecember 3, 2014\n\u001c125\n\u0011\n\u0011"},{"ty":"te","id":"i.83","spi":33713},{"ty":"te","id":"i.84","spi":33997},{"ty":"te","id":"i.85","spi":34211},{"ty":"te","id":"i.86","spi":34756},{"ty":"te","id":"i.87","spi":35308},{"ty":"te","id":"i.88","spi":35856},{"ty":"te","id":"i.89","spi":35893},{"ty":"te","id":"i.90","spi":36067},{"ty":"te","id":"i.91","spi":36974},{"ty":"te","id":"i.92","spi":37642},{"ty":"as","st":"paragraph","si":33704,"ei":33704,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":33705,"ei":33705,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":33706,"ei":33706,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":33708,"ei":33708,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":33710,"ei":33710,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":33712,"ei":33712,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":